interface IRouteWithProps extends RouteProps {
  // path: string;
  // component: React.FC<RouteComponentProps>;
  p?: any;
  // eslint-disable-next-line react/prop-types
}
const RouteWithProps: React.FC<IRouteWithProps> = function ({ path, component: Comp, p }) {
  console.log(p);
  return (
    <Route
      exact
      path={path}
      render={(props) => {
        return <Comp {...props} pv={p} />;
      }}
    />
  );
};
export { RouteWithProps };
